import React from 'react';

//nav-bar
import AppNavigator from './components/AppNavigator';

//BottomTabNavigator
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Icon from 'react-native-vector-icons/Ionicons';
import HomeScreen from './components/bottom-nav-bar/HomeScreenBottom';
import ProfileScreenBottom from './components/bottom-nav-bar/ProfileScreenBottom';
import BottomTabNavigator from './components/bottom-nav-bar/BottomNavigator';


const Tab = createBottomTabNavigator();

function App() {
  return (
  <>
  <AppNavigator />
  <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeScreen} />
        <Tab.Screen name="Profile" component={ProfileScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  </>
  );
}

export default App;
